CREATE DEFINER=`root`@`localhost` FUNCTION `F_SEGUIM_PROYE_FICHA`(
  p_proy_id integer,
  p_fich_id integer
) RETURNS varchar(3000) CHARSET latin1
BEGIN

-- trae todos los comentarios por fase en uno solo por ficha de un proy  
  -- pyoy 8 fich 48
  DECLARE v_respuesta varchar(3000) DEFAULT '';
  DECLARE v_reg varchar(500) DEFAULT '';
  DECLARE v_fin INTEGER DEFAULT 0;
  
  DECLARE c_seguim CURSOR FOR
   SELECT concat(fase_deno,' ',DATE_FORMAT(seff_alta_f,'%d/%m/%Y'),':',char(13),seff_seguimiento,char(13))
     FROM seguim_proy_ficha_fases,
			fase
    WHERE seff_fase_id = fase_id 
	  AND seff_proy_id = p_proy_id
	  AND seff_fich_id = p_fich_id
      AND seff_baja_f is null;


  DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_fin = 1;
  OPEN c_seguim;
    loop1: LOOP
      FETCH c_seguim INTO v_reg;
      IF v_fin = 1 THEN
        LEAVE loop1;
      END IF;
      SET v_respuesta = CONCAT(v_respuesta, char(13), v_reg);
    END LOOP loop1;
  CLOSE c_seguim;
  
  RETURN SUBSTRING(v_respuesta,1,CHAR_LENGTH(v_respuesta));
    
END ;;
