CREATE DEFINER=`root`@`localhost` PROCEDURE `AM_PROYECTO_FICHA_RS`(
  IN p_user varchar(50),
  IN p_proy_id varchar(20),
  IN p_lista_fichas_apli varchar(500)
)
BEGIN
  DECLARE v_respuesta varchar(100) DEFAULT 'OK';
  DECLARE v_errores varchar(2000) DEFAULT NULL;
  DECLARE v_sql varchar(1000);
  DECLARE v_lista varchar(500) DEFAULT p_lista_fichas_apli;

-- call AM_PROYECTO_FICHA_RS('admin','2','1,2,')
  
-- Borro todas y repongo las Ok
BEGIN 
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
	BEGIN 
		ROLLBACK;
		SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al delete proyecto_fichas','AM_PROYECTO_FICHA_RS');
	END; 
	    
	DELETE from proyecto_fichas
	where prof_proy_id = p_proy_id;
END; 

BEGIN 
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
	BEGIN 
		ROLLBACK;
		SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al insert temp #lisfich','AM_PROYECTO_FICHA_RS');
	END; 
	
	set v_lista = left(v_lista,length(v_lista) - 1);
	set v_lista = concat('INSERT INTO lisfich VALUES (',replace(v_lista,',','),('),');');
	DROP TEMPORARY TABLE IF EXISTS lisfich;
	CREATE TEMPORARY TABLE lisfich (ficha int NULL);
	SET @query = v_lista;
	PREPARE stmt FROM @query;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END;


BEGIN 
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
	BEGIN 
		ROLLBACK;
		SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al insert proyecto_fichas','AM_PROYECTO_FICHA_RS');
	END; 
    
    
    INSERT INTO proyecto_fichas (prof_proy_id,
								prof_fich_id,
								prof_alta_f,
								prof_alta_usu) 
	  select  p_proy_id,
			  lisfich.ficha,
			  date(CURDATE()),
			  p_user
		from lisfich;
END;


  IF v_respuesta = 'OK' THEN
  	 
	 INSERT INTO usu_accesos_log (usal_usua_nombre,usal_empre,usal_clave,usal_codigo_char,usal_vistas,usal_alta_f)
          VALUES  (p_user,1,
        'ACTUALIZA PROYECTO',
        p_proy_id,concat('Incluye fichas ',' fichas (',v_lista,')'),now());
  ELSE
     SET v_respuesta := 'No se puede concretar la operacion : '||v_errores; 
  END IF;
  COMMIT;
  
  SELECT v_respuesta as respuesta,
         case when v_respuesta = 'OK' then 'Actualización correcta' else '' end as respues_exito
    FROM DUAL;  
END ;;
DELIMITER ;
