CREATE DEFINER=`root`@`localhost` PROCEDURE `AM_PROYECTO_RS`(
  IN p_user varchar(50),
  IN p_proy_id int,
  IN p_proy_nombre varchar(500),
  IN p_proy_obser varchar(500),
  IN p_proy_inicio_f date,
  IN p_proy_fin_estimado_f date,
  IN p_proy_pais_id int,
  IN p_proy_prov_id int,
  IN p_proy_loca_id int,
  IN p_proy_domicilio varchar(100),
  IN p_proy_tama_id int,
  IN p_proy_medi_id int,
  IN p_proy_tipo_id int,
  OUT out_id int
)
BEGIN
  DECLARE v_proy_id_dup int; 
  DECLARE v_respuesta varchar(100) DEFAULT 'OK';
  DECLARE v_errores varchar(2000) DEFAULT NULL;
  DECLARE out_id  int;
  DECLARE v_proy_id int DEFAULT p_proy_id;
 
  
-- valildo que no haya otra denominacion igual
/* select proy_id into v_proy_id_dup 
				from proyecto
		where fich_deno like trim(p_fich_deno)
				and (fich_id != p_fich_id or p_fich_id is null);

	if v_fich_id_dup is not null then
	  set v_respuesta = concat('Esta denominacion ya existe para ficha ',v_fich_id_dup);
	end if;
*/
if v_respuesta = 'OK' then   

	IF NOT EXISTS (SELECT 1 FROM proyecto
						WHERE proy_id = p_proy_id) THEN
		  BEGIN -- alta
			DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
			BEGIN -- de excepcion
				ROLLBACK;
				SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al insert ficha','AM_PROYECTO_RS');
			END; -- de excepcion
			
			INSERT INTO proyecto (
			  proy_id,
			  proy_nombre,
              proy_inicio_f,
			  proy_fin_estimado_f,
              proy_pais_id,
              proy_prov_id,
              proy_loca_id,
              proy_domicilio,
			  proy_obser,
              proy_tama_id,
              proy_medi_id,
              proy_tipo_id,
              proy_fase_actual,
              proy_alta_f,
			  proy_alta_usu)
			select p_proy_id,
			  p_proy_nombre,
              p_proy_inicio_f,
			  p_proy_fin_estimado_f,
              p_proy_pais_id,
              p_proy_prov_id,
              p_proy_loca_id,
              p_proy_domicilio,
              p_proy_obser,
              p_proy_tama_id,
			  p_proy_medi_id,
              p_proy_tipo_id,
              min(fase_id),
			  date(CURDATE()),
			  p_user
              from fase
              where fase_orden = (select min(fase_orden) 
									from fase 
									where fase_baja_f is null);
		
        		set v_proy_id = LAST_INSERT_ID();
		  END; -- alta
		  
	ELSE -- no es alta
			BEGIN -- modifica
			  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
			  BEGIN -- de excepcion
				ROLLBACK;
				SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al update ficha','AM_PROYECTO_RS');
			  END; -- de excepcion

			  UPDATE proyecto
				 SET proy_nombre    = p_proy_nombre,
					 proy_obser 	= p_proy_obser,
                     proy_inicio_f  = p_proy_inicio_f,
                     proy_fin_estimado_f = p_proy_fin_estimado_f,
                     proy_pais_id   = p_proy_pais_id,
                     proy_prov_id   = p_proy_prov_id,
                     proy_loca_id   = p_proy_loca_id,
                     proy_domicilio = p_proy_domicilio,
					 proy_tama_id 	= p_proy_tama_id,
                     proy_medi_id	= p_proy_medi_id,
                     proy_tipo_id	= p_proy_tipo_id,
					 proy_baja_f    = null
			   WHERE proy_id = p_proy_id;
		  
			END; 
		  
	  END IF;


	INSERT INTO usu_accesos_log (usal_usua_nombre,usal_orden,usal_empre,usal_clave,usal_codigo_number,usal_codigo_char,usal_vistas,usal_alta_f)
	values  (p_user,
			1,
			1,
			'ACTUALIZA PROYECTO',
			v_proy_id,
			'proyecto',
			concat('Proyecto:',p_proy_nombre,
					' Inicio:',DATE_FORMAT(p_proy_inicio_f,'%d/%m/%Y'),
                    ' Fin estim:',DATE_FORMAT(p_proy_fin_estimado_f,'%d/%m/%Y'),
                    ' Pais:', p_proy_pais_id,
                    ' Prov:', p_proy_prov_id,
                    ' Loc:', p_proy_loca_id,
                    ' Domic:', p_proy_domicilio,
					' Tamaño:', p_proy_tama_id,
                    ' Medio:', p_proy_medi_id,
                    ' Tipo:', p_proy_tipo_id
                    ),
			now());
	  
	COMMIT;
    
end if;
  
  SELECT v_respuesta as respuesta,
         case when v_respuesta = 'OK' then 'Actualización correcta' else '' end as respues_exito, 
         v_proy_id as respuesta_id
    FROM DUAL;
 

  
END ;;
