CREATE DEFINER=`root`@`localhost` PROCEDURE `AM_SEGUIM_PROYE_FICHA_FASE_RS`(
IN p_user varchar(50),
IN p_proy_id integer,
IN p_fich_id integer,
IN p_fase_id integer,
IN p_text text)
BEGIN

 DECLARE v_respuesta varchar(100) DEFAULT 'OK';
 DECLARE v_errores varchar(2000) DEFAULT NULL;
 DECLARE v_accion varchar(50) DEFAULT 'Seguimiento';

-- call AM_SEGUIM_PROYE_FICHA_FASE_RS('admin',9,1,1,'modifico algo')
BEGIN 
DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
	BEGIN 
	ROLLBACK;
	SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al ins/mod seguim_proy_ficha_fases','AM_SEGUIM_PROYE_FICHA_FASE_RS');
	END; 
   
if exists(select 1 
		from seguim_proy_ficha_fases 
		where seff_proy_id = p_proy_id
		and seff_fich_id = p_fich_id
		and seff_fase_id = p_fase_id) then

	if trim(p_text) = '' or p_text is null then -- Si viene en blanco le damos baja	
		update seguim_proy_ficha_fases set seff_baja_f = date(CURDATE()),
										   seff_baja_usu = p_user
		where seff_proy_id = p_proy_id
		and seff_fich_id = p_fich_id
		and seff_fase_id = p_fase_id;	
        
        set v_accion = 'Baja de segumiento';
	else
		update seguim_proy_ficha_fases set  seff_seguimiento = p_text,
						seff_alta_f = date(CURDATE()),
						seff_alta_usu = p_user,
                        seff_baja_f = null,
                        seff_baja_usu = null
		where seff_proy_id = p_proy_id
		and seff_fich_id = p_fich_id
		and seff_fase_id = p_fase_id;
        
        set v_accion = 'Mofifica seguimiento';
    end if;
else  

	if trim(p_text) <> '' then
		INSERT INTO seguim_proy_ficha_fases (
		seff_proy_id,
		seff_fich_id,
		seff_fase_id,
        seff_seguimiento,
		seff_alta_f,
		seff_alta_usu)
		VALUES (p_proy_id,
		p_fich_id,
		p_fase_id,
        p_text,
		date(CURDATE()),
		p_user);
	end if;
end if;

END; 

IF v_respuesta = 'OK' THEN
	INSERT INTO usu_accesos_log (usal_usua_nombre,usal_orden,usal_empre,usal_clave,usal_codigo_char,usal_vistas,usal_alta_f)
	VALUES  (p_user,1,1,
			'ACTUALIZA PROYECTO',
            p_proy_id,
            concat(v_accion,' proyecto:',p_proy_id,' ficha:',p_fich_id,' fase:',p_fase_id, 'txt:',p_text),now());
ELSE
	SET v_respuesta = concat('No se puede concretar la operacion : ',v_respuesta); 
END IF;

COMMIT;

 SELECT v_respuesta as respuesta,
        case when v_respuesta = 'OK' then 'Actualización correcta' else '' end as respues_exito
   FROM DUAL; 
   
   
   
   
END ;;
DELIMITER ;
