/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_ABM_PROYECTO_RS`(
   IN p_user char(50),
   IN p_estado char(1),
   IN p_fase_actual int(11),
   IN p_fecha_desde_inicio char(10),
   IN p_nombre varchar(50),
   IN p_propios_todos char(1))
BEGIN

-- estado = T=todos / A=Abiertos / C=cerrados
DECLARE v_nombre varchar(50);
DECLARE v_select    varchar(3000);
DECLARE v_where     varchar(3000);

-- call GET_ABM_PROYECTO_RS ('admin','T','17-01-2017','manipula','P')

set v_nombre = concat("%",rtrim(upper(p_nombre)),"%");
 
SET v_select = 'SELECT proy_id,
 proy_nombre,
 proy_inicio_f,
 proy_fin_estimado_f,
 proy_loca_id,
 proy_obser,
 tama_deno,
 medi_deno,
 tipo_deno,
 fase_deno as fase_deno_actual,
     proy_alta_usu';

SET v_where = ' FROM proyecto
join tamanio on tama_id = proy_tama_id
   join medio   on medi_id = proy_medi_id
   join tipologia on tipo_id = proy_tipo_id
   join fase on fase_id = proy_fase_actual
WHERE proy_baja_f is null ';


IF p_estado = 'A' THEN   
set v_where = concat(v_where,' and proy_cierre_f is null');
END IF;
IF p_estado = 'C' THEN   
set v_where = concat(v_where,' and proy_cierre_f is not null');
END IF;

IF p_fase_actual <> 0 THEN
set v_where = concat(v_where,' and proy_fase_actual =',p_fase_actual);
END IF;

IF p_fecha_desde_inicio <> '' THEN
set v_where = concat(v_where,' and proy_inicio_f >= #',p_fecha_desde_inicio,'#');
END IF;

IF p_nombre <> '' THEN
set v_where = concat(v_where,' and upper(proy_nombre) like #',v_nombre,'#');
END IF; 

IF p_propios_todos = 'P' THEN
set v_where = concat(v_where,' and proy_alta_usu  = #',p_user,'#');
END IF;

SET v_where = REPLACE(v_where,'#',CHAR(39 USING ASCII));
SET v_select = REPLACE(v_select,'#',CHAR(39 USING ASCII));

-- select concat(v_select,v_where);

SET @_sql = concat(v_select,v_where);
PREPARE smpt FROM @_sql;

EXECUTE smpt;

DEALLOCATE PREPARE smpt;
 

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
