CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_CATALOGO_RS`(
  IN p_cata_id int,
  IN p_todos char(1)
)
BEGIN
SELECT cata_id, 
	   f_proper(cata_deno) as cata_deno,
       f_proper(cata_deno_redu) as cata_deno_redu
FROM catalogo
WHERE (cata_id = p_cata_id or p_cata_id is null)
AND cata_baja_f is null
UNION
select 0 as cata_id,
		'(todos)' as cata_deno,
        '(todos)' as cata_deno_redu
        from dual
        where p_todos ='S'
UNION
select 0 as cata_id,
		'(seleccionar)' as cata_deno,
        '(seleccionar)' as cata_deno_redu
        from dual
        where p_todos ='V'
        
  UNION  -- para utilizar cuando se utiliza required
	select '' as cata_id,
		   '(Seleccionar)' as cata_deno,
		   '' as cata_deno_redu
	from dual
	where p_todos = 'B'
    
order by 2;
END ;;
DELIMITER ;
