CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_PROYECTO_FICHAS_NO_RELACIONADAS_RS`(
IN p_prof_proy_id INT(11),
IN p_proy_medi_id INT(11),
IN p_proy_tama_id INT(11),
IN p_proy_tipo_id INT(11)
)
BEGIN

-- call GET_PROYECTO_FICHAS_NO_RELACIONADAS_RS (8,3,1,4);

	SELECT fich_id,
		   fich_deno,
           case when prof_alta_f is null then 'N' else 'S' end as si_no
	FROM ficha
		left outer join proyecto_fichas on prof_proy_id = p_prof_proy_id
									   and prof_fich_id = fich_id
     WHERE (fich_baja_f is null)
	 AND NOT EXISTS (select 1 from ficha_medios where fime_medi_id =  p_proy_medi_id AND 
													 fime_fich_id = fich_id AND
													 fime_baja_f is null)
    UNION
    
    SELECT fich_id,
		   fich_deno,
           case when prof_alta_f is null then 'N' else 'S' end as si_no
	FROM ficha
		left outer join proyecto_fichas on prof_proy_id = p_prof_proy_id
									   and prof_fich_id = fich_id
     WHERE (fich_baja_f is null)
	 AND NOT EXISTS (SELECT 1 FROM ficha_tamanio where fita_tama_id = p_proy_tama_id AND
													  fita_fich_id = fich_id AND
													  fita_baja_f is null)
	UNION

  	SELECT fich_id,
		   fich_deno,
           case when prof_alta_f is null then 'N' else 'S' end as si_no
	FROM ficha
		left outer join proyecto_fichas on prof_proy_id = p_prof_proy_id
									   and prof_fich_id = fich_id
     WHERE (fich_baja_f is null)
		AND NOT EXISTS (SELECT 1 FROM ficha_tipologias where fiti_tipo_id = p_proy_tipo_id AND
														 fiti_fich_id = fich_id AND
														 fiti_baja_f is null)
												
						
	order by 2;
    
END ;;
