CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_PROYECTO_RS`(
  IN p_proy_id int
)
BEGIN
SELECT proy_id,
    proy_nombre,
    proy_inicio_f,
    proy_fin_estimado_f,
    proy_pais_id,
    proy_prov_id,
    proy_loca_id,
    proy_domicilio,
    proy_obser,
    proy_alta_f,
    proy_alta_usu,
	proy_tama_id,
    proy_medi_id,
    proy_tipo_id,
    proy_fase_actual,
    cpai_pais,
    cprv_provincia,
    cloc_localidad,
    tama_deno,
    tipo_deno,
    medi_deno
FROM proyecto
   left outer join camp_paises on proy_pais_id = cpai_id_pais
   left outer join camp_provincias on proy_pais_id = cprv_id_pais
								  and proy_prov_id = cprv_id_provincia
   left outer join camp_localidades on proy_pais_id = cloc_id_pais
								  and proy_prov_id = cloc_id_provincia
                                  and proy_loca_id = cloc_id_localidad
   left outer join tamanio 	 	on proy_tama_id = tama_id
   left outer join tipologia 	on proy_tipo_id = tipo_id
   left outer join medio 		on proy_medi_id = medi_id
WHERE (proy_id = p_proy_id or p_proy_id is null)
AND proy_baja_f is null
order by 2;
END ;;
DELIMITER ;
