SELECT tipo_id, 
	   f_proper(tipo_deno) as tipo_deno,
       f_proper(tipo_deno_redu) as tipo_deno_redu
FROM tipologia
WHERE (tipo_id = p_tipo_id or p_tipo_id is null)
AND tipo_baja_f is null
 UNION
		select 0 as tipo_id,
		'(todos)' as tipo_deno,
        '(todos)' as tipo_deno_redu
        from dual
        where p_todos ='S'

 UNION
	select '' as tipo_id,
		   '(Seleccionar)' as tipo_deno,
		   '' as tipo_deno_redu
	from dual
	where p_todos = 'B'

order by 2;
END ;;
