  IN p_proy_id int,
  IN p_proy_id_fase_actual varchar(50)
)
BEGIN
  DECLARE v_respuesta varchar(100) DEFAULT 'OK';
  DECLARE v_errores varchar(2000) DEFAULT NULL;


	BEGIN -- modifica
	  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION
	  BEGIN -- de excepcion
		ROLLBACK;
		SET v_respuesta = F_ZZI_LOG_ERR(p_user,'ERROR interno al update proyecto','M_CIERRE_PROYECTO_RS');
	  END; -- de excepcion

	  UPDATE proyecto
		 SET 
			 proy_fase_actual 	= p_proy_id_fase_actual,
			 proy_cierre_f  = date(CURDATE())
	   WHERE proy_id = p_proy_id;
  
	END; 


	INSERT INTO usu_accesos_log (usal_usua_nombre,usal_orden,usal_empre,usal_clave,usal_codigo_number,usal_codigo_char,usal_vistas,usal_alta_f)
	values  (p_user,
			1,
			1,
			'ACTUALIZA PROYECTO',
			p_proy_id,
			'Cierre proyecto',
			concat('Cierre de Proyecto:',p_proy_id,' en fase ',p_proy_id_fase_actual),
			now());

	COMMIT;
    
  
  SELECT v_respuesta as respuesta,
         case when v_respuesta = 'OK' then 'Actualización correcta' else '' end as respues_exito
    FROM DUAL;
 

  
END ;;
