CREATE DEFINER=`root`@`localhost` PROCEDURE `SEL_SEGUIM_PROYE_FICHA`(
IN p_proy_id integer,
IN p_fich_id integer,
IN p_fase_id integer)
BEGIN

-- segumiento de esa fase
-- call SEL_SEGUIM_PROYE_FICHA(8,48,1)
if exists(select 1 
			from seguim_proy_ficha_fases 
					where seff_proy_id = p_proy_id
					and seff_fich_id = p_fich_id
					and seff_fase_id = p_fase_id) then
	select seff_seguimiento,  
		F_SEGUIM_PROYE_FICHA(p_proy_id,p_fich_id) as seff_seguim_full, 
		seff_alta_f 
	from seguim_proy_ficha_fases 
			where seff_proy_id = p_proy_id
			and seff_fich_id = p_fich_id
			and seff_fase_id = p_fase_id;
else
	select '' as seff_seguimiento,  
		F_SEGUIM_PROYE_FICHA(p_proy_id,p_fich_id) as seff_seguim_full, 
		null as seff_alta_f;

end if;

END ;;
