IN p_fase_id integer)
BEGIN

-- call SEL_SEGUIM_PROYE_FICHA_FASE_RS(9,1)
SELECT fich_id, 
	fich_deno, 
	case when seff_alta_f is null then 'N' else 'S' end as tiene_seguimiento
FROM proyecto
		join proyecto_fichas on prof_proy_id = proy_id
							and prof_baja_f is null
		join ficha_fases 	on prof_fich_id = fifa_fich_id
							and fifa_fase_id = p_fase_id
		join ficha 			on  prof_fich_id = fich_id
		left outer join seguim_proy_ficha_fases on  seff_proy_id = proy_id
											and seff_fich_id = prof_fich_id
											and seff_fase_id = fifa_fase_id
											and seff_baja_f is null
where proy_id = p_proy_id
order by 2;

END ;;
