        v_log,
        'S',
        NOW(),
        p_user
      );
    END;
  END IF;
  COMMIT; 
  
  SELECT v_respuesta as respuesta,
         case when v_respuesta = 'OK' then 'Roles actualizados correctamente' else '' end as respues_exito
    FROM DUAL;  
  
